import {
	BrowserRouter as Router,
} from "react-router-dom";

import { Navbar } from "./components";

import './App.css';
import { useState } from "react";

function App() {
	const [theme, setTheme] = useState('light');

	return (
		<ThemeContext.Provider value={{ theme, setTheme }}>
			<Router>
				<Navbar />
			</Router>
		</ThemeContext.Provider>

		);
	}

	export default App;
